message:
Вчера Зеленский сделал ряд заявлений для украинцев. На этот раз в большей степени была уже конкретика.

Главное:

- президент издал указ относительно призыва резервистов в особый период;
- 21 февраля РФ признала «ЛДНР» и сразу на следующий день позволила вооруженным силам РФ использование за рубежом - на Донбассе;
- вчера глава Белого дома Джо Байден заявил о введении санкций в отношении РФ и ЛДНР. Великобритания применит санкции против российских банков и олигархов. Германия вводит санкционные меры против проекта «Северный поток-2». В частности, Канада тоже ввела санкции;
- пока что нет необходимости всеобщей мобилизации.
- он обозначил цель - энергетическая независимость.
